import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import { BrowserRouter as Router  , Route , Switch } from 'react-router-dom';
import Login from './components/login';


function App() {
  return (
    <div className='App'>
      <header className='App-header'>
         <Router>
    <Switch>
      <Route path = './login'> 
      <Login/>

      </Route>
    </Switch>



   </Router>
   </header>
   </div>

  );
}

export default App;
